he packing detail on the description of each product, please check it. Thank you!</p><p>Q: I am a reseller. I would like to buy many pieces of your item, what\\\'s the wholesale price?</p><p>A: Hi, thanks for your inquiry, if you would like to buy large quantity, please send email to us, we will give you the best price, thanks!</p><p>test</p>', 1, 'https://p16-oec-va.ibyteimg.com/tos-maliva-i-o3syd03w52-us/8041e8c68f84432380b4cc3c0f758f5c~tplv-o3syd03w52-origin-jpeg.jpeg?,https://p16-oec-va.ibyteimg.com/tos-maliva-i-o3syd03w52-us/70ab3693d8a34784bb4a057bb30ef760~tplv-o3syd03w52-origin-jpeg.jpeg?,https://p16-oec-va.ibyteimg.com/tos-maliva-i-o3syd03w52-us/71ef2315d12048fa90abb4e026e34b90~tplv-o3syd03w52-origin-jpeg.jpeg?,https://p16-oec-va.ibyteimg.com/tos-maliva-i-o3syd03w52-us/7672bbfca90847b2b2671e3f06f9f538~tplv-o3syd03w52-origin-jpeg.jpeg?,https://p16-oec-va.ibyteimg.com/tos-maliva-i-o3syd03w52-us/57c359704b90438699fe1b5754884cb8~tplv-o3syd03w52-origin-jpeg.jpeg?,https://p16-oec-va.ibyteimg.com/tos-maliva-i-o3syd03w52-us/6cc9003f01584c2f8038516e67c4bccf~tplv-o3syd03w52-origin-jpeg.jpeg?,https://p16-oec-va.ibyteimg.com/tos-maliva-i-o3syd03w52-us/b389847d5c6d495281c496a6ca43551e~tplv-o3syd03w52-origin-jpeg.jpeg?,https://p16-oec-va.ibyteimg.com/tos-maliva-i-o3syd03w52-us/2a8aa2384d874ea1821cabd1255a9a00~tplv-o3syd03w52-origin-jpeg.jpeg?,https://p16-oec-va.ibyteimg.com/tos-maliva-i-o3syd03w52-us/28f50f5fb7fb4a0bb930642495ee752a~tplv-o3syd03w52-origin-jpeg.jpeg?', 'https://p16-oec-va.ibyteimg.com/tos-maliva-i-o3syd03w52-us/8041e8c68f84432380b4cc3c0f758f5c~tplv-o3syd03w52-resize-jpeg:300:300.jpeg?,https://p16-oec-va.ibyteimg.com/tos-maliva-i-o3syd03w52-us/70ab3693d8a34784bb4a057bb30ef760~tplv-o3syd03w52-resize-jpeg:300:300.jpeg?,https://p16-oec-va.ibyteimg.com/tos-maliva-i-o3syd03w52-us/71ef2315d12048fa90abb4e026e34b90~tplv-o3syd03w52-resize-jpeg:300:300.jpeg?,https://p16-oec-va.ibyteimg.com/tos-maliva-i-o3syd03w52-us/7672bbfca90847b2b2671e3f06f9f538~tplv-o3syd03w52-re