  `shop_region` varchar(16) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '店铺所在地区,tiktok返回',
  `product_number` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '商品数量',
  `sales` int(1) UNSIGNED NULL DEFAULT 0 COMMENT '订单数量',
  `gmv` float(10, 2) NULL DEFAULT NULL COMMENT '销售额',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `aid`(`aid`) USING BTREE,
  INDEX `account_id`(`account_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 8 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = 'tiktok店铺列表' ROW_FORMAT = Dynamic;

